  const [LoggedIn, setLoggedIn] = useState(2);
  const AppContext = createContext({})
  return (
    <Router>
      <div className="App">
        <AppContext.Provider value={{ test: "test" }}>
          <Header />
          <Content />
        </AppContext.Provider>

      </div>
    </Router>
  );
}

export default App;
